<p>Le Plan d'pargne Retraite (PER) s'est impos comme le vhicule privilgi de prparation de la retraite depuis sa cration par la loi PACTE. Ce dispositif offre une rduction d'impt immdiate sur les versements et une capitalisation en franchise d'impt, avec une sortie possible en rente viagre ou en capital. Les diffrentes versions du PER (individuel, collectif, obligatoire) permettent d'adapter votre stratgie  votre situation professionnelle.</p>

