<p>Les stratgies de dmembrement de proprit (sparation entre usufruit et nue-proprit) offrent des opportunits intressantes pour prparer  la fois sa retraite et la transmission de son patrimoine. Par exemple, l'acquisition d'un bien immobilier en nue-proprit avec reconstitution automatique de la pleine proprit  l'ge de la retraite peut constituer une approche fiscalement efficiente.</p>

