<p>Sur un horizon long comme celui de la prparation  la retraite, l'investissement en actions (via PEA, compte-titres ou units de compte d'assurance-vie) constitue historiquement la classe d'actifs la plus performante. Une approche progressive d'investissement rgulier (versements programms) permet de lisser les points d'entre et de bnficier des effets positifs de la capitalisation et des dividendes rinvestis.</p>

