<p>Principalement investies en immobilier d'entreprise (bureaux, commerces, entrepts), elles visent  maximiser la distribution de revenus rguliers aux associs. Leur rendement moyen se situe gnralement entre 4% et 6% par an, nettement suprieur aux placements scuriss traditionnels.</p>

