<p>Avec des tickets d'entre gnralement compris entre 200 et 1000 par part, les SCPI permettent d'investir dans l'immobilier avec un capital limit et d'accder immdiatement  un patrimoine diversifi gographiquement et sectoriellement, rduisant ainsi le risque global de votre investissement.</p>

