<p>L'acquisition de parts de SCPI en direct est adapte pour gnrer des revenus complmentaires immdiats ou pour diversifier un patrimoine dj constitu. L'achat  crdit peut permettre un effet de levier intressant, particulirement dans un contexte de taux bas.</p>

